(function($){"use strict";$.fn.instagram=function(options){var $this=this,settings={tag:null,client_id:null,proxy:null,display:5};for(var key in settings)options.hasOwnProperty(key)&&options[key]!==void 0&&(settings[key]=options[key]);$.ajax({url:settings.proxy,type:"GET",dataType:"json",data:{client_id:settings.client_id,tag:settings.tag},success:function(data){console.log(data);for(var hits=data.data,images=[],i=0;hits.length>i;i++){var hit=hits[i];images.push({thumb:hit.images.thumbnail.url,full:hit.images.standard_resolution.url,text:hit.caption.text,created:parseInt(hit.created_time),filter:hit.filter,likes:hit.likes.count,name:hit.user.full_name})}images.sort(function(a,b){return b.created-a.created}),images=images.slice(0,settings.display),console.log(images);for(var i=0;images.length>i;i++){var image=images[i];$this.append('<img src="'+image.thumb+'" title="'+image.text+'" onclick="window.open(\''+image.full+"')\" />")}},error:function(){console.error("instagram: failed to load.")}})}})(jQuery);